import React,{useState, useEffect} from 'react';
import './App.css';
import Cards from './Cards'
import axios from 'axios'

function App() {
  const [data,setData]=useState(null)
  useEffect(()=>{
    axios.get('http://localhost:5000')
    .then(res => {
    console.log(res.status)
    setData(res.data) })
  })

  return (
    <div className="App">
      {data!=null}?<Cards data={data}/>:<br/>

    </div>
  )
}

export default App;
